export const PATH_HOME = '/home';
export const PATH_PRODUCTS = '/products';
export const PATH_ABOUT = '/about';
export const PATH_TEAM = '/team';
export const PATH_CONTACT = '/contact';
export const PATH_ACCOUNT = '/account';
export const PATH_LOGIN = '/login';
export const PATH_LOGOUT = '/logout';

export const LINKS_NAV = [
    { path: PATH_HOME, label: 'Home' },
    { path: PATH_PRODUCTS, label: 'Products' },
    { path: PATH_ABOUT, label: 'About' },
    { path: PATH_TEAM, label: 'Team' },
    { path: PATH_CONTACT, label: 'Contact' },
    { path: PATH_ACCOUNT, label: 'Account' },
    { path: PATH_LOGIN, label: 'Login' },
    { path: PATH_LOGOUT, label: 'Logout' }
];
